import asynciofrom typing import Unionfrom src.base.log import Loggerasync def request_log(urls: list[str],                      time_zone: tuple,                      query_contents: Union[list, set, str]):    """    日志查询指定时间范围内包含指定的全部内容的日志数据    Args:        urls: 查询的URL列表异步查询这些url        time_zone: 日志查询的时间范围，支持 yyyy-mm-dd yyyy-mm-dd HH:MM:SS的写法        query_contents: 查list表示列表内的每个元素都必须在日志内出现，set表示集合内的某一个元素在日志内出现即可    Returns: 符合要求的日志数据    """    logger = Logger()    await logger.request_log(urls=urls,                             time_zone=time_zone,                             query_contents=query_contents)if __name__ == '__main__':    asyncio.run(request_log(urls=['http://127.0.0.1:18868/log'],                            time_zone=('2024-04-29 23:38:00', '2024-04-30 00:30:00'),                            query_contents=["特斯拉", "inference"]))